import React from "react";
import * as DataHandler from "../../data/DataHandler";
import LineChart from "../reusable/LineChart";
import { isPropertySignature } from "typescript";

const imgAlphaCap = require("../../assets/images/alphaCapture.png");
const data = {
  id: 2,
  img: imgAlphaCap,
  title: "Alpha Capture",
  subtitle: "A Trade Idea Tracker",
  blurb: [""],
  bkgd: "var(--alphaCap-bkgd)"
};
function AlphaCapCard() {
  // constructor() {
  //   super();
  // }
  function percentFormatFn(d) {
    return Math.round(d * 10000) / 100 + "%";
  }
  return (
    <article className="portfolio-card" style={{ backgroundColor: data.bkgd }}>
      <div className="text-section">
        <h1 className="title">{data.title}</h1>
        <h4 className="subtitle">{data.subtitle}</h4>
      </div>
      <LineChart
        data={DataHandler.alphaCaptureChartData}
        valueArray={[
          {
            dataKey: "pricePercent",
            color: "#7f5ada",
            marker: "#956ff5",
            tooltipLabel: "Price %"
          },
          {
            dataKey: "benchmarkPercent",
            color: "#93bb96",
            marker: "#aadeae",
            tooltipLabel: "Benchmark %"
          }
        ]}
        myID={"alphaCap"}
        numberFormatFn={percentFormatFn}
        resize={props.resize}
      />
      {/* {props.data.divs} */}
      {/* <div
          style={{ backgroundColor: "yellow", width: "50%", height: "15px" }}
        ></div> */}
      {/* <div class="blurb-thumb">
          <p className="blurb">{props.data.blurb}</p>
          <div className="thumb">
            <img src={props.data.img} alt={props.data.subtitle} />
          </div>
        </div> */}
    </article>
  );
}

export default AlphaCapCard;
